selector_to_html = {"a[href=\"#solution\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Solution<a class=\"headerlink\" href=\"#solution\" title=\"Link to this heading\">#</a></h2><h3>Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>From Lecture 7, we know that the sensitivity function <span class=\"math notranslate nohighlight\">\\(S(s)\\)</span> is the transfer function between <span class=\"math notranslate nohighlight\">\\(V(s)\\)</span> and <span class=\"math notranslate nohighlight\">\\(Y(s)\\)</span>:</p>", "a[href=\"#solutions-of-exercise-5-1\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Solutions of Exercise 5.1<a class=\"headerlink\" href=\"#solutions-of-exercise-5-1\" title=\"Link to this heading\">#</a></h1><p>Consider the control system in <a class=\"reference internal\" href=\"#fig-lec-ex1-sol-block\"><span class=\"std std-numref\">Fig. 41</span></a>, where <span class=\"math notranslate nohighlight\">\\(v(t)\\)</span> is a sinusoidal disturbance <span class=\"math notranslate nohighlight\">\\(v(t) = \\sin(\\omega t)\\)</span>.</p>", "a[href=\"#fig-lec5-ex1-sol-bode\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex1-sol-bode\">\n<a class=\"reference internal image-reference\" href=\"../_images/e5d0361e287f4f35bf9456a95889f5638924b7f643bb867486ddb28810341c0a.png\"><img alt=\"../_images/e5d0361e287f4f35bf9456a95889f5638924b7f643bb867486ddb28810341c0a.png\" src=\"../_images/e5d0361e287f4f35bf9456a95889f5638924b7f643bb867486ddb28810341c0a.png\" style=\"width: 75%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 42 </span><span class=\"caption-text\">Magnitude Bode plot of <span class=\"math notranslate nohighlight\">\\(G(s)\\)</span></span><a class=\"headerlink\" href=\"#fig-lec5-ex1-sol-bode\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#question-2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2<a class=\"headerlink\" href=\"#question-2\" title=\"Link to this heading\">#</a></h3><p>Since <span class=\"math notranslate nohighlight\">\\(S(s)\\)</span>, the Frequency Response Theorem tells us that <span class=\"math notranslate nohighlight\">\\(\\lvert Y(i \\omega)\\lvert = \\lvert S(i \\omega) \\lvert \\cdot \\lvert V(i \\omega) \\lvert\\)</span> where, in our case, <span class=\"math notranslate nohighlight\">\\(\\omega = 1\\)</span>. The attenuation factor of <span class=\"math notranslate nohighlight\">\\(4\\)</span> is achieved if</p>", "a[href=\"#question-1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>From Lecture 7, we know that the sensitivity function <span class=\"math notranslate nohighlight\">\\(S(s)\\)</span> is the transfer function between <span class=\"math notranslate nohighlight\">\\(V(s)\\)</span> and <span class=\"math notranslate nohighlight\">\\(Y(s)\\)</span>:</p>", "a[href=\"#alternative-solution-via-bode-plots\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Alternative solution via Bode plots<a class=\"headerlink\" href=\"#alternative-solution-via-bode-plots\" title=\"Link to this heading\">#</a></h3><p>The problem could have been solved very easily with Bode plots. Even though approximate, this solution is the suggested one.</p><p>We start by noting that  <span class=\"math notranslate nohighlight\">\\(G_o(s) = G(s)\\)</span> for <span class=\"math notranslate nohighlight\">\\(K=1\\)</span>. For this specific <span class=\"math notranslate nohighlight\">\\(K\\)</span>, we can sketch the sensitivity function\u2019s magnitude plot according to:</p>", "a[href=\"#fig-lec-ex1-sol-block\"]": "<figure class=\"align-default\" id=\"fig-lec-ex1-sol-block\">\n<a class=\"reference internal image-reference\" href=\"../_images/ex1-block.svg\"><img alt=\"../_images/ex1-block.svg\" src=\"../_images/ex1-block.svg\" style=\"width: 750px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 41 </span><span class=\"caption-text\">Block diagram of the control system</span><a class=\"headerlink\" href=\"#fig-lec-ex1-sol-block\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#attenuation\"]": "<aside class=\"footnote brackets\" id=\"attenuation\" role=\"doc-footnote\">\n<span class=\"label\"><span class=\"fn-bracket\">[</span><a href=\"#id1\" role=\"doc-backlink\">1</a><span class=\"fn-bracket\">]</span></span>\n<p>That is, the effect of <span class=\"math notranslate nohighlight\">\\(v(t)\\)</span> on the output <span class=\"math notranslate nohighlight\">\\(y(t)\\)</span> is <span class=\"math notranslate nohighlight\">\\(\\frac{1}{9}\\)</span> of the maximum amplitude of <span class=\"math notranslate nohighlight\">\\(v(t)\\)</span>, in this case <span class=\"math notranslate nohighlight\">\\(1\\)</span>. In this case, we say that the closed-loop achieves an attenuation factor of <span class=\"math notranslate nohighlight\">\\(9\\)</span> for disturbances at frequency <span class=\"math notranslate nohighlight\">\\(\\omega = 1\\)</span>.</p>\n</aside>", "a[href=\"#fig-lec5-ex1-sol-sketch-sensitivity-1\"]": "<figure class=\"align-default\" id=\"fig-lec5-ex1-sol-sketch-sensitivity-1\">\n<a class=\"reference internal image-reference\" href=\"../_images/8e505121c19d29a5a996bee2d1e70b71429d007d74b9a48cee189ef78a94b6b5.png\"><img alt=\"../_images/8e505121c19d29a5a996bee2d1e70b71429d007d74b9a48cee189ef78a94b6b5.png\" src=\"../_images/8e505121c19d29a5a996bee2d1e70b71429d007d74b9a48cee189ef78a94b6b5.png\" style=\"width: 75%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 43 </span><span class=\"caption-text\">Sketch of the sensitivity function\u2019s magnitude plot according to the asymptotic Bode plot of <span class=\"math notranslate nohighlight\">\\(G_o(s)\\)</span> for <span class=\"math notranslate nohighlight\">\\(K=1\\)</span>.</span><a class=\"headerlink\" href=\"#fig-lec5-ex1-sol-sketch-sensitivity-1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#equation-eq-lec5-ex1-sensitivity-mag\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-lec5-ex1-sensitivity-mag\">\n\\[\n\\lvert S(i \\omega) \\lvert = \\sqrt{ \\frac{2}{(K-1)^2 + 1}}\n\\]</div>", "a[href=\"exercise-5.1-more-details.html#ref-lec5-ex1-more-details\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Plotting the exact Sensitivity function<a class=\"headerlink\" href=\"#plotting-the-exact-sensitivity-function\" title=\"Link to this heading\">#</a></h1><p>In case you are curious, below you can find the code to plot the exact sensitivity transfer function.</p>", "a[href=\"#equation-eq-lec5-ex1-sensitivity-rule\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-lec5-ex1-sensitivity-rule\">\n\\[\\begin{split}\n\\lvert S(i \\omega) \\lvert_{\\text{dB}} \\approx \\begin{dcases}\n- \\lvert G_o (i \\omega) \\lvert_{\\text{dB}} &amp; \\text{where } \\lvert G_o (i \\omega) \\lvert_{\\text{dB}} &lt; 0\\text{dB} \\\\\n0 ~\\text{dB} &amp; \\text{where } \\lvert G_o (i \\omega) \\lvert_{\\text{dB}} &gt; 0 \\text{dB}\n\\end{dcases}\n\\end{split}\\]</div>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: false,
                placement: 'auto-start', maxWidth: 500, interactive: true, boundary: document.body, appendTo: document.body,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {var isFirefox=typeof InstallTrigger!=='undefined';if(isFirefox&&window.MathJax&&MathJax.startup&&MathJax.startup.output&&MathJax.startup.output.name==="SVG"){const svgs=instance.popper.querySelectorAll('svg');svgs.forEach(svg=>{let bbox=svg.getBBox(),x=bbox.x,y=bbox.y,width=bbox.width,height=bbox.height;svg.setAttribute('width',width);svg.setAttribute('height',height);svg.setAttribute('viewBox',`${x} ${y} ${width} ${height}`);});let rescale=0.015;svgs.forEach(svg=>{let bbox=svg.getBBox(),width=bbox.width,height=bbox.height;svg.setAttribute('width',width*rescale);svg.setAttribute('height',height*rescale);});}});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
